import React, { useState, useEffect } from "react";



export const Mission = () => {

    const [missionData, handleMissionData] = useState([])
    async function getUserAsync() {
        let response = await fetch(`https://api.spacexdata.com/v3/launches?limit=100`);
        let data = await response.json()
        return handleMissionData(data);
    }

    useEffect(() => {
        getUserAsync().then(data => data);
    }, []);

    console.log(missionData, "==>")

    return (
        <div>{missionData.map((mission, index): any => (
            <span>{mission['mission_id']}</span>
        ))} </div>
    )

}
